package com.ufgov.zc.common.zc.model;import java.io.Serializable;public class ZcEvaluation extends ZcBaseBill implements Serializable {  /**   *    */  private static final long serialVersionUID = 1L;  private String projectCode;  private String projectName;  private String packCode;  private String packName;  private String userId;  private String userName;  private String createDate;  private String evaluationContent;  private String status;  public ZcEvaluation() {  }  public String getProjectCode() {    return projectCode;  }  public void setProjectCode(String projectCode) {    this.projectCode = projectCode;  }  public String getProjectName() {    return projectName;  }  public void setProjectName(String projectName) {    this.projectName = projectName;  }  public String getPackCode() {    return packCode;  }  public void setPackCode(String packCode) {    this.packCode = packCode;  }  public String getPackName() {    return packName;  }  public void setPackName(String packName) {    this.packName = packName;  }  public String getUserId() {    return userId;  }  public void setUserId(String userId) {    this.userId = userId;  }  public String getUserName() {    return userName;  }  public void setUserName(String userName) {    this.userName = userName;  }  public String getEvaluationContent() {    return evaluationContent;  }  public void setEvaluationContent(String evaluationContent) {    this.evaluationContent = evaluationContent;  }  public static long getSerialversionuid() {    return serialVersionUID;  }  public String getCreateDate() {    return createDate;  }  public void setCreateDate(String createDate) {    this.createDate = createDate;  }  public String getStatus() {    return status;  }  public void setStatus(String status) {    this.status = status;  }}